import React from 'react';

const FilterBar = (props) => {
    const { checkbox } = props;
      
    return (
            <div className="filter">
                        <li key={checkbox.id}>
                            <input 
                                type="radio"
                                value={checkbox.label} 
                                id={checkbox.label}
                                
                            />
                            <label htmlFor={checkbox.label}>{checkbox.label}</label>
                        </li>
                    )
                
            </div>
    );
};

export default FilterBar;
